                }}
            />
            <AvatarUsingProps
                size={50}
                person={{
                    name: 'Lin Lanying',
                    imageId: '1bX5QH6',
                    url: 'https://i.imgur.com/1bX5QH6.jpg'

                }}
            />
        </div>
    );
}
